    false,nt"url": null,nt"notes": "These data are the characteristics and
    acorn counts from 2005 of individual live oak trees found in 0.05-ha circular habitat
    plots at Spears and Didion Ranches, Placer County, California. Acorns were counted
    over a 30-second period at each tree using binoculars. Each count involved two 15-second
    periods, one counting a lower section of a tree and one counting an upper section.
    Counts were done in mid-September 2005. Trees were tagged with individually numbered
    2' diameter aluminum tree tags at 4.5 ft above the ground with the tags facing towards
    the center of the 0.05-ha sampling plot. There were three 0.05-ha circular habitat
    sampling plots at each of the 15 sample points, and there were 2-4 oaks per vegetation
    plot.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
